import React from 'react'
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const Footer = () => {
  return ( 
    <FooterContainer>
      <FooterWrap>
        <FooterLinksContainer>
          <FooterLinksWrapper>
            <FooterLinkItems>
              <FooterLinkTitle>Acerca de</FooterLinkTitle>
              <FooterLink to="/especialidades">Terms of Service</FooterLink>
              <FooterLink to="/cursos">Careers</FooterLink>
            </FooterLinkItems>
            <FooterLinkItems>
              <FooterLinkTitle>Redes sociales</FooterLinkTitle>
              <FooterLink to="/especialidades">Terms of Service</FooterLink>
              <FooterLink to="/cursos">Careers</FooterLink>
            </FooterLinkItems>
            <FooterLinkItems>
             <FooterLinkTitle>Profesores</FooterLinkTitle>
              <FooterLink to="/especialidades">Universities</FooterLink>
              <FooterLink to="/cursos">Careers</FooterLink>
            </FooterLinkItems>
          </FooterLinksWrapper>
        </FooterLinksContainer>
      </FooterWrap>
    </FooterContainer>
   );
}

const FooterContainer = styled.footer`
  background-color: #141618;

`;

const FooterWrap = styled.div`
  padding: 48px 24px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  max-width: 1100px;
  margin: 0px auto;

`;

const FooterLinksContainer = styled.div`
  display: flex;
  justify-content: center;

  @media screen and (max-width: 820px){
    padding-top: 32px;
  }
`;

const FooterLinksWrapper = styled.div`
  display: flex;

  @media screen and (max-width: 820px){
    flex-direction: column;
  }
`;

const FooterLinkItems = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  margin: 16px;
  text-align: left;
  width: 160px;
  box-sizing: border-box;
  color: #fff;

  @media screen and (max-width: 420px){
    margin: 0;
    padding: 10px;
    width: 100%;
  }
`;

const FooterLinkTitle = styled.h2`
  font-size: 14px;
  margin-bottom: 16px;
  color: #FAFDFF;
`;

const FooterLink = styled.p`
  color: #fff;
  text-decoration: none;
  margin-bottom: 0.5rem;
  font-size: 14px;

  &:hover{
    color: #00BFF0;
    transition: 0.3ms ease-out;
  }
`;


export default Footer;
